import "./App.css";
import Items from "./components/Items/Items";
import NavBar from "./components/Navbar/NavBar";

function App() {
   const food = [
      {
         id: 1,
         name: "Sushi",
         desc: "Finest fish and veggies",
         price: 22.99,
      },
      {
        id: 2,
        name: "Schnitzel",
        desc: "A german speciality!",
        price: 16.50,
     },
     {
      id: 3,
      name: "Barbecue Burger",
      desc: "Finest fish and veggies",
      price: 22.99,
   },
   ];

   return (
      <div className="App">
         <NavBar />
         <Items />
      </div>
   );
}

export default App;
